import React, {useState} from "react";

function Track(props) {
    const {track, addToPlaylist} = props;

    const handleClick = () => {
        addToPlaylist(track.id);
    }

    return(
        <li className="Track">
            <div className="songName">{track.name}</div>
            <div className="songInfo">{track.artist}+' '+{track.album}</div>
            <button 
                type="button"
                className="playlistAdd"
                aria-label="Add to playlist"
                onClick={handleClick}>
                    +
            </button>
        </li>
    )
}

export default Track;
